// assemble vectors
import org.apache.spark.ml.feature.{Bucketizer, Imputer, OneHotEncoderEstimator, StringIndexer, VectorAssembler}
import org.apache.spark.ml.linalg.{DenseVector, Vector, Vectors}
import org.apache.spark.sql.DataFrame
import org.apache.spark.sql.functions._
import org.apache.spark.sql.types.{DecimalType, DoubleType, IntegerType, LongType}
  def assembleFeature(x: DataFrame, featureCols: Array[String]): DataFrame = {
    val assembler = new VectorAssembler()
      .setInputCols(featureCols)
      .setOutputCol("features")

    val output = assembler.transform(x)
    output.drop(featureCols: _*)
  }


val trainDf = assembleFeature(df, Array("slicedFeatures", "length"))
trainDf.printSchema
